import React from "react";
import Header from "../src/components/generic/Header";
import MeetupSection from "../src/components/MeetupSection";
import PageSection from "../src/components/PageSection";
import { useDispatch } from "react-redux";
import { categoryDataRequest } from "../src/redux/actions";

export default function HomePage(props) {
  const dispatch = useDispatch();

  useEffect(() => {
    getCategory();
  }, []);

  async function getCategory() {
    const res = await fetch(
      "https://api.gyftr.net/smartbuyapi/hdfc/api/v1/home/categories"
    );
    const categories = await res.json();
    dispatch(categoryDataRequest(categories))
  }

  return (
    <div className="home-page">
      <Header route={props.router.route} />
      <PageSection />
      <MeetupSection />
    </div>
  );
}

HomePage.getInitialProps = async (ctx) => {
  return {};
};
